// src/pages/DashboardCustomer.jsx
import React, { useEffect, useState, useCallback } from "react";
import axios from "axios";
import { Container, Row, Col, Card, Button, Form, Spinner } from "react-bootstrap";

export default function DashboardCustomer() {
  const [suppliers, setSuppliers] = useState([]);
  const [customerLocation, setCustomerLocation] = useState(null);
  const [loading, setLoading] = useState(true);
  const [query, setQuery] = useState("");

  const haversine = useCallback((lat1, lon1, lat2, lon2) => {
    const R = 6371;
    const toRad = (d) => (d * Math.PI) / 180;

    const dLat = toRad(lat2 - lat1);
    const dLon = toRad(lon2 - lon1);

    const a =
      Math.sin(dLat / 2) ** 2 +
      Math.cos(toRad(lat1)) *
        Math.cos(toRad(lat2)) *
        Math.sin(dLon / 2) ** 2;

    return R * 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
  }, []);

  // ðŸ”¥ Get customer location
  useEffect(() => {
    navigator.geolocation.getCurrentPosition(
      (p) => setCustomerLocation({ lat: p.coords.latitude, lng: p.coords.longitude }),
      () => setCustomerLocation(null),
      { enableHighAccuracy: true }
    );
  }, []);

  // ðŸ”¥ Fetch supplier list
  useEffect(() => {
    const fetchData = async () => {
      setLoading(true);
      const token = localStorage.getItem("token");

      const res = await axios.get(
        "http://localhost:5000/api/customer/dashboard",
        { headers: { Authorization: `Bearer ${token}` } }
      );

      let list = (res.data.suppliers || []).filter((s) => s.isOnline);

      if (customerLocation) {
        list = list.map((s) => ({
          ...s,
          distance: haversine(
            customerLocation.lat,
            customerLocation.lng,
            s.coordinates.lat,
            s.coordinates.lng
          )
        }));

        list.sort((a, b) => a.distance - b.distance);
      }

      setSuppliers(list);
      setLoading(false);
    };

    fetchData();
  }, [customerLocation, haversine]);

  return (
    <Container className="mt-5">
      <h2>Customer Dashboard</h2>

      <Form.Control
        placeholder="Search supplier..."
        value={query}
        onChange={(e) => setQuery(e.target.value)}
        className="my-3"
      />

      {loading ? (
        <div className="text-center"><Spinner /></div>
      ) : (
        <Row>
          {suppliers
            .filter(
              (s) =>
                s.name.toLowerCase().includes(query.toLowerCase()) ||
                s.area.toLowerCase().includes(query.toLowerCase())
            )
            .map((s) => (
              <Col md={4} key={s._id} className="mb-4">
                <Card>
                  <Card.Body>
                    <Card.Title>{s.name}</Card.Title>

                    <Card.Text>
                      <strong>Area:</strong> {s.area} <br />
                      <strong>Price:</strong> â‚¹{s.pricePerUnit} <br />
                      <strong>Units:</strong> {s.availableUnits} <br />
                      <strong>Distance:</strong>{" "}
                      {s.distance ? s.distance.toFixed(2) + " km" : "N/A"}
                    </Card.Text>

                    <Button>Book</Button>
                  </Card.Body>
                </Card>
              </Col>
            ))}
        </Row>
      )}
    </Container>
  );
}
